import OptionModel from "./OptionModel";

export default class QuestionModel{

    private _questionId :number;
    private _title:string;
    private _optionType:string;
    private _options:Array<OptionModel>;
 
    // constructor(questionId:number,title:string,optionType:string,options:Array<OptionModel>){
    //     this._questionId = questionId;
    //     this._title = title;
    //     this._optionType = optionType;
    //     this._options = options;
    // }
    constructor(){
        
    }

    //getters setters
    get questionId():number{
        return this._questionId;
    }
    get title():string{
        return this._title;
    }
    get optionType():string{
        return this._optionType;
    }
    get options() :Array<OptionModel>{
        return this._options;
    }
  
    set questionId(questionId:number){
        this._questionId = questionId;
    } 
    set title(title:string  ){
        this._title = title;
    }
    set optionType(optionType:string){
        this._optionType = optionType;
    }
    set options(options:Array<OptionModel>){
        this._options = options;
    }

}
